import { type } from "node:os";
import Chart from "react-apexcharts";

type SeriesData = {
    name: string;
    data: number[];
}


type ChartData = {
    labels: {
        categories: string[];
    };
    series: SeriesData[];
}


const BarChart = () => {

    const [chartData, setCharData] = useState<chartData>()
    const options = {
        plotOptions: {
            bar:{
                horizontal: true,
            }
        }
    }

    const mockData = {
        labels: {
            categories: ['Anakin', 'Barry Allen', 'Kal-El', 'Logan', 'Padmé' ]
        },
        series: [
            {
                name: "% Sucesso",
                data: [43.6, 67.1, 45.6, 71.1]
            }
        ]
    };

    return (
        <Chart
            options={{...options, xaxis: mockData.labels}}
            series={mockData.series }
            type="bar"
            height="240"
        />

    );
}

export default BarChart;
